import React from "react";
const newblock = {
    backgroundColor: "whitesmoke",
    borderRadius: "50px",
    display: "block",
    width: "1200px",
    height: "600px",
    textAlign: "center",
    marginLeft: "220px",
    marginTop: "40px",
    alignContent: "center",
}

export default class graphForm extends React.Component {
    render() {
        return (
            <div style={newblock}>hello
            <h1>hello this is form</h1>
            </div>
        );
    }
}
